import React, { useState } from 'react';
import { Toaster } from 'react-hot-toast';
import { motion, AnimatePresence } from 'framer-motion';
import { Upload, BookOpen, Settings, Download } from 'lucide-react';

import { ProcessingState, ProcessingResult } from './types';
import ImageUploader from './components/ImageUploader';
import SpineVisualizer from './components/SpineVisualizer';
import BookListManager from './components/BookListManager';
import ProcessingStatus from './components/ProcessingStatus';
import FinalizePanel from './components/FinalizePanel';

const App: React.FC = () => {
  const [processingState, setProcessingState] = useState<ProcessingState>({
    status: 'idle',
    progress: 0,
    message: 'Ready to process images'
  });
  
  const [processingResult, setProcessingResult] = useState<ProcessingResult | null>(null);
  const [selectedSpineId, setSelectedSpineId] = useState<string | null>(null);
  const [isFinalized, setIsFinalized] = useState(false);

  const handleImageProcessed = (result: ProcessingResult) => {
    setProcessingResult(result);
    setProcessingState({
      status: 'completed',
      progress: 100,
      message: `Processed ${result.total_spines} spines with ${result.successful_matches} successful matches`
    });
  };

  const handleSpineSelected = (spineId: string) => {
    setSelectedSpineId(spineId);
  };

  const handleFinalize = () => {
    setIsFinalized(true);
  };

  const handleUnfinalize = () => {
    setIsFinalized(false);
  };

  return (
    <div className="min-h-screen bg-gray-50">
      <Toaster position="top-right" />
      
      {/* Header */}
      <header className="bg-white shadow-sm border-b border-gray-200">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex items-center justify-between h-16">
            <div className="flex items-center space-x-3">
              <BookOpen className="h-8 w-8 text-primary-600" />
              <h1 className="text-2xl font-bold text-gray-900">Spinecat</h1>
              <span className="text-sm text-gray-500 bg-gray-100 px-2 py-1 rounded-full">
                Book Spine Detection
              </span>
            </div>
            
            <div className="flex items-center space-x-4">
              <button className="btn-secondary flex items-center space-x-2">
                <Settings className="h-4 w-4" />
                <span>Settings</span>
              </button>
            </div>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <AnimatePresence mode="wait">
          {processingState.status === 'idle' && (
            <motion.div
              key="upload"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              exit={{ opacity: 0, y: -20 }}
              transition={{ duration: 0.3 }}
              className="text-center"
            >
              <ImageUploader
                onImageProcessed={handleImageProcessed}
                onProcessingStateChange={setProcessingState}
              />
            </motion.div>
          )}

          {processingState.status === 'processing' && (
            <motion.div
              key="processing"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              exit={{ opacity: 0 }}
              className="text-center"
            >
              <ProcessingStatus state={processingState} />
            </motion.div>
          )}

          {processingState.status === 'completed' && processingResult && (
            <motion.div
              key="results"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              exit={{ opacity: 0, y: -20 }}
              transition={{ duration: 0.3 }}
              className="space-y-6"
            >
              {/* Results Header */}
              <div className="flex items-center justify-between">
                <div>
                  <h2 className="text-2xl font-bold text-gray-900">
                    Processing Complete
                  </h2>
                  <p className="text-gray-600 mt-1">
                    {processingResult.total_spines} spines detected • {processingResult.successful_matches} successful matches
                  </p>
                </div>
                
                {!isFinalized && (
                  <button
                    onClick={handleFinalize}
                    className="btn-primary flex items-center space-x-2"
                  >
                    <Download className="h-4 w-4" />
                    <span>Finalize & Export</span>
                  </button>
                )}
              </div>

              {/* Main Results Layout */}
              <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
                {/* Left: Image with Spine Regions */}
                <div className="lg:col-span-2">
                  <SpineVisualizer
                    imageUrl={processingResult.image_url}
                    spineRegions={processingResult.spine_regions}
                    bookMatches={processingResult.book_matches}
                    selectedSpineId={selectedSpineId}
                    onSpineSelected={handleSpineSelected}
                    isFinalized={isFinalized}
                  />
                </div>

                {/* Right: Book List Management */}
                <div className="space-y-6">
                  <BookListManager
                    bookMatches={processingResult.book_matches}
                    ocrFailures={processingResult.ocr_failures}
                    selectedSpineId={selectedSpineId}
                    onSpineSelected={handleSpineSelected}
                    onBookListUpdated={(updatedMatches) => {
                      setProcessingResult(prev => prev ? {
                        ...prev,
                        book_matches: updatedMatches
                      } : null);
                    }}
                  />
                </div>
              </div>

              {/* Finalize Panel */}
              {isFinalized && (
                <motion.div
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.3 }}
                >
                  <FinalizePanel
                    processingResult={processingResult}
                    onUnfinalize={handleUnfinalize}
                  />
                </motion.div>
              )}
            </motion.div>
          )}

          {processingState.status === 'error' && (
            <motion.div
              key="error"
              initial={{ opacity: 0, scale: 0.95 }}
              animate={{ opacity: 1, scale: 1 }}
              exit={{ opacity: 0, scale: 0.95 }}
              className="text-center"
            >
              <div className="card max-w-md mx-auto">
                <div className="text-error-600 text-6xl mb-4">⚠️</div>
                <h3 className="text-lg font-semibold text-gray-900 mb-2">
                  Processing Error
                </h3>
                <p className="text-gray-600 mb-4">
                  {processingState.error || 'An unexpected error occurred'}
                </p>
                <button
                  onClick={() => setProcessingState({
                    status: 'idle',
                    progress: 0,
                    message: 'Ready to process images'
                  })}
                  className="btn-primary"
                >
                  Try Again
                </button>
              </div>
            </motion.div>
          )}
        </AnimatePresence>
      </main>
    </div>
  );
};

export default App;
